import NavBar from "../../Components/NavBarHome";
import HeaderHome from "../../Components/HeaderHome";
import MainHome from "../../Components/MainHome";
import { useState, useEffect } from "react";
import Modal from "../../Components/Modal";
import { useNavigate } from "react-router-dom";
import axios from "axios";
function Home() {
  const Navigate = useNavigate();
  const [modalOn, setModalOn] = useState(false);
  const [dadosUsuario, setDadosUsuario] = useState("");
  const token = localStorage.getItem("@token");
  const userId = localStorage.getItem("@userid");
  console.log(dadosUsuario.techs);
  useEffect(() => {
    if (token === null) {
      Navigate("/login");
    }
  }, []);

  useEffect(() => {
    const data = {
      headers: {
        Authorization: `Bearer ${token}`,
      },
    };
    axios
      .get("https://kenziehub.herokuapp.com/profile", data)
      .then((res) => setDadosUsuario(res.data));
  }, []);
  const [techArray, setTechArray] = useState(dadosUsuario.techs);
  return (
    <div>
      <NavBar />
      <HeaderHome dadosUsuario={dadosUsuario} />
      <MainHome
        setModal={setModalOn}
        techArray={techArray}
        setTechArray={setTechArray}
      />
      {modalOn ? (
        <Modal setModal={setModalOn} setTechArray={setTechArray} />
      ) : null}
    </div>
  );
}
export default Home;
